import Nav from "./Nav";

export default function Header() {
  return (
    <div>
      <div className="bar">
        <h1>
          <a href="">Sick Fits</a>
        </h1>
        <Nav />
      </div>
      <div className="sub-bar">
        <p>Search</p>
      </div>
      <div>Cart</div>
    </div>
  );
}
